import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import UserList from "./UserList ";
import "./Login.css";
import axios from "axios";

function SetAdmin() {
  const navigate = useNavigate();
  const [userList, setUserList] = useState([]);
  useEffect(() => {
    let url = "/user/infoes";
    const fetchData = async () => {
      const result = await axios.get(url);
      //유저 정보가 존재하지 않을경우 로그인 페이지
      //   if (
      //     result.data === "" ||
      //     result.data.userProfileId.userAccount === "" ||
      //     result.data.userProfileId.userAccount === undefined ||
      //     result.length === 0
      //   ) {
      //     navigate("/login");
      //   } else {
      //     setUserList();
      console.log(result);
      setUserList(result.data);

      //   }
    };
    fetchData();
  }, []);

  return (
    <div>
      <div className="set_admin_box">
        <div className="set_admin_title">관리자 설정</div>
        <table className="set_admin_header_box">
          <tr>
            <td>
              <input className="chk_user_list_all" type="checkbox"></input>
            </td>
            <td className="">사용자</td>
            <td className="">권한</td>
          </tr>
        </table>
        <div className="set_admin_user_list">
          {userList.length !== 0 ? userList.map((user) => <UserList userInfo={user} key={`user_id-${user.id}`} />) : ""}
        </div>
      </div>
    </div>
  );
}
export default SetAdmin;
